import Button from "../Components/Button";
function CTASection(){
    return(
        <section id="">
            <div>
                <h1>Crash course Launch Offer (Save INR 1799)</h1>
                <ul>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
            </div>
            <div>
                <p>Price of the Program <br/> 499</p>
                <Button>Register Now</Button>
            </div>
        </section>
    )
}

export default CTASection;
